trailingComments.value:
*
 * 打开图片浏览
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @link https://lark.alipay.com/alwxapp/androidteam/zmz84g JS桥文档
 *
 * @returns {Promise<Object>}
 *
 * @example
 * const params = {
 *   // 图集信息
 *   imgs: [{
 *     bigImgUrl: 'http://img-tailor.11222.cn/bcv/big/201702241744292170.jpg', // 大图地址
 *     smallImgUrl: 'http://img-tailor.11222.cn/bcv/small/201702241744292170.jpg', // optional, 小图地址
 *   }, {
 *     bigImgUrl: 'http://img-tailor.11222.cn/bcv/big/201711131600535673.jpg', // 大图地址
 *     smallImgUrl: 'http://img-tailor.11222.cn/bcv/small/201711131600535673.jpg', // optional, 小图地址
 *   }, {
 *     bigImgUrl: 'http://img-tailor.11222.cn/bcv/big/201702181520188904.jpg', // 大图地址
 *     smallImgUrl: 'http://img-tailor.11222.cn/bcv/small/201702181520188904.jpg', // optional, 小图地址
 *   }, {
 *     bigImgUrl: 'http://img-tailor.11222.cn/bcv/big/201706211333002338.jpg', // 大图地址
 *     smallImgUrl: 'http://img-tailor.11222.cn/bcv/small/201706211333002338.jpg', // optional, 小图地址
 *   }],
 *   type: '1', // optional, 打开类型，1为普通图片浏览
 *   index: '2', // optional, 第几张图片，默认0
 * };
 * libSQ.exec('browse-images', {
 *  params,
 * }).catch((err) => {
 *   alert(`[browse-images][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });
 *
 *
 * @todo 文档

